import React from 'react'
import Navbar from "./components/Navbar";
import Home from "./components/Home";
import About from "./components/About";
import Skills from "./components/Skills";
import Services from "./components/Services";
import Contact from "./components/Contact";

import { BrowserRouter , Route, Routes, Link } from 'react-router-dom';
const App = () => {
  return (
    <div className='hero'>
        <h1>Welcome to Navbar Page</h1>
        <>
        <BrowserRouter>
                <Routes>
                    <Route path="/" component={Home} exact> <Home /> </Route>
                    <Route path="/about" component={About} exact> <About /></Route>
                    <Route path="/skills" component={Skills} exact> <Skills />  </Route>
                    <Route path="/services" component={Services} exact>  <Services /> </Route>
                    <Route path="/contact" component={Home} Contact> <Contact />  </Route>
                </Routes>
        </BrowserRouter>
        </>
    </div>
  )
}

export default App
